import OrganizationChart from './OrganizationChart';
import NurPatientList from './NurPatientList';
const Common = ({loggedInUsername}) => {
  return (
    <div className={loggedInUsername ? 'inCarePlus' : 'outCarePlus'}>
    {loggedInUsername && (
      <>
        <Header loggedInUsername={loggedInUsername} />
        <Sidebar />
        <Routes>
                    <Route path="/organ" exact element={ <OrganizationChart />} />
                    <Route path="/wardPatientList" element={<NurPatientList />} />
                    {/* 다른 경로에 대한 Route 설정 */}

                  </Routes>
      </>
    )}

  </div>
  );
};

export default Common;
